import React from 'react'

class GameList extends React.Component {
    getVideoGames = () => {
        fetch("https://wild-games.herokuapp.com/api/v1")
        .then(res => res.json())
        .then(res => console.log("result", res))
    }
    componentDidMount() {
        this.getVideoGames()
    }
    render(){
        return(
            <div>Checkpont 2</div>
        )
    }
}
export default GameList
